+    ($a:ident, $a:ident) => {}; //~WARNING duplicate matcher binding
+    ($a:ident, $a:path) => {};  //~WARNING duplicate matcher binding
 }

 macro_rules! foo2 {
@@ -14,8 +18,8 @@ macro_rules! foo2 {
 }

 macro_rules! foo3 {
